        </div>
        <style jsx>{`
            .main-logo{
                padding: 1em 2em 0em 2em;
                border: 2px solid #fff;
            }
            .logo{
                font-size: 3.4rem;
                font-family: 'Abril Fatface';
                border-bottom: 2px solid #fff;
                padding-bottom: 0.5rem;
